import React from 'react';
import { FaBriefcase, FaChartLine, FaPencilAlt } from 'react-icons/fa';
import { Link } from 'react-router-dom';
import styled from 'styled-components';


const NavbarContainer = styled.div`
    display: flex;
    justify-content: space-between;
    align-items: center;
    background-color: #FFFFFF;
    padding: 10px 20px;
    color: #333;
`;

const Logo = styled.img`
    height: 50px;

`;

const NavIcons = styled.div`
    display: flex;
`;

const Icon = styled.div`
    cursor: pointer;
    font-size: 20px;
    padding: 0 35px; /* Add padding to each icon */
`;

const CompanyName = styled.div`
    font-size: 20px;
`;

const Divider = styled.hr`
    border: none;
    border-top: 1px solid #DDDDDD;
    margin: 0;
`;

const Navbar = () => {
    return (
        <>
            <NavbarContainer>
                <Logo src="/assets/images/jobmate.png" alt="Logo" />
                <NavIcons>
                    <Link to="/employer/dashboard" className="btn btn-primary"><FaBriefcase title="Jobs" /></Link>
                    <Icon><FaChartLine title="Progress" /></Icon>
                    {/* <Link to="/progress" className="btn btn-primary"><FaChartLine title="Progress" /></Link> */}
                    <Link to="/employer/create_job" className="btn btn-primary"><FaPencilAlt title="Create Job" /></Link>
                </NavIcons>
                <CompanyName>Grey</CompanyName>
            </NavbarContainer>
            <Divider />
        </>
    );
};

export default Navbar;
